import React, { Component } from "react";
import { connect } from "react-redux";
import { Badge, Table } from "reactstrap";
import { bindActionCreators } from "redux";
import * as homeActions from "../../redux/actions/homeActions";

class HomeList extends Component {
  componentDidMount() {
    this.props.actions.getHomes();
  }

  render() {
    return (
      <div>
        <h3>
          <Badge style={{ marginRight: "10px" }} color="warning">
            Homes
          </Badge>
          <Badge color="success">
            {this.props.currentCategory.categoryName}
          </Badge>
        </h3>
        {/* <Row>
          {this.props.homes.map((home) => (
            <Col
              className="home"
              style={{ border: "1px solid black", borderRadius: "5px" }}
              xs="4"
            >
              <div className="image" style={{ margin: "10px" }}>
                <img src={home.image} alt="" style={{ borderRadius: "10px" }} />
              </div>
              <div className="text">
                <h4>{home.title}</h4>
                <p>{home.address}</p>
              </div>
            </Col>
          ))}
        </Row> */}

        <Table>
          <thead>
            <tr>
              <th>#</th>
              <th>Name</th>
            </tr>
          </thead>
          <tbody>
            {/* {this.state.homes.map((product) =>(
              <tr>
              <th scope="row">{product.id}</th>
              <td>{product.productName}</td>
            </tr>
            ))} */}
          </tbody>
        </Table>
      </div>
    );
  }
}

function mapStateToProps(state) {
  return {
    currentCategory: state.changeCategoryReducer,
    homes: state.homeListReducer,
  };
}

function mapDispacthToProps(dsipatch) {
  return {
    actions: {
      getHomes: bindActionCreators(homeActions.getHomes, dsipatch),
    },
  };
}

export default connect(mapStateToProps, mapDispacthToProps)(HomeList);
